import 'bootstrap/dist/css/bootstrap.min.css'
import React, { useState } from 'react';
import SideNav from '../components/sidenav';
import NavBar from '../components/navbar';
import Calendar from '../components/calendar'
import { Container, Col} from 'react-bootstrap';


function WalletPage() {
    const [selectedDate, setSelectedDate] = useState(new Date());

    const navStatus = {
        active1: false,
        active2: true,
    };
    return(
        <div className="d-flex vh-100">
            <div className="flex-shrink-0">
                <SideNav actives={navStatus} />
            </div>
            <div className="d-flex flex-column flex-grow-1 overflow-hidden">
                <NavBar />
                <Container fluid className="flex-grow-1 d-flex flex-row justify-content-center align-items-center p-0">
                    <Col className="w-100 justify-content-center">
                        <Col xs={12} md={8} lg={6} xl={4} className="text-center">
                                <Calendar selectedDate={selectedDate} setSelectedDate={setSelectedDate}/>
                                <p>Selected Date: {selectedDate.toDateString()}</p>
                        </Col>
                    </Col>
                </Container>
            </div>
        </div>
    );
}

export default WalletPage;
